  FaInstagram,
  FaTwitter,
  FaEnvelope,
  FaLinkedinIn,
  FaGithub,
  FaYoutube,
  FaGlobe
} from 'react-icons/fa';

function Footer() {
  return (
    <footer className="footer">
      <div className="social-icons">
        <a href="https://facebook.com" target="_blank" rel="noopener noreferrer"><FaFacebookF /></a>
        <a href="https://instagram.com" target="_blank" rel="noopener noreferrer"><FaInstagram /></a>
        <a href="https://twitter.com" target="_blank" rel="noopener noreferrer"><FaTwitter /></a>
        <a href="mailto:youremail@example.com"><FaEnvelope /></a>
        <a href="https://linkedin.com" target="_blank" rel="noopener noreferrer"><FaLinkedinIn /></a>
        <a href="https://github.com" target="_blank" rel="noopener noreferrer"><FaGithub /></a>
        <a href="https://youtube.com" target="_blank" rel="noopener noreferrer"><FaYoutube /></a>
        <a href="https://yourwebsite.com" target="_blank" rel="noopener noreferrer"><FaGlobe /></a>
      </div>
      <p className="footer-text m-2">Â© {new Date().getFullYear()} Web Stories. All rights reserved.</p>
    </footer>
  );
}

export default Footer;
